import React from "react";

import { LeftArrowContainer } from "./Arrows.styles";

const RightArrow = ({ goToPrev }) => (
	<LeftArrowContainer onClick={goToPrev}>
		<i class="fas fa-arrow-circle-left "></i>
	</LeftArrowContainer>
);

export default RightArrow;
